PAGES  = {dir: false};
/* # Variables # */

/*   Core   */
CORE.getURL    = function() {
	var surl           = decodeURI(window.location)
	var curl           = new String(surl);
	CORE.url           = {};
	CORE.url.hash      = (window.location.hash.length > 1) ? window.location.hash.substr(1) : '';
	CORE.url.domain    = curl.split('//')[1].split('/')[0];
	CORE.url.params    = curl.split('?')[1] ? curl.split('?')[1].split('#')[0] : false;
	CORE.url.directory = curl.split(CORE.url.domain)[1] ? curl.split(CORE.url.domain)[1].split('?')[0].split('#')[0].substr(1) : false;
	CORE.url.full      = surl;
};
CORE.inURL     = function(txt) {
	if (CORE.url.full.indexOf(txt) > -1) return true;
	else return false;
};
CORE.formsInit = function() {
	$("form.ajax").off().on("submit", function(e) {
		e.preventDefault();
		var self = $(this);
		var url  = self.attr("action");
		if (!url) return false;
		$(".error", self).removeClass("error");
		
		// Data
		var error = false;
		var data  = {};
		$("input, textarea, select", self).each(function() {
			var name     = $(this).attr("name");
			var value    = $(this).val();
			var required = $(this).hasClass("required");
			
			if (name) {
				if (!value && required) {
					error = true;
					$(this).parent().addClass("error");
				} else {
					// Single or multiple values
					if (name.indexOf("[") < 0) {
						data[name] = $(this).val();
					} else {
						// Checkboxes
						if ($(this).attr("type") == "checkbox") {
							if ($(this).prop("checked")) {
								data[name] = $(this).val();
							}
						}
					}
				}
			}
		});
		
		// Debug
		//console.log(data);
		//return false;
		
		// Error
		if (error) {
			return false;
		}
		
		// Submitting
		$.post("/ajax/" + url + ".php", data, function(data) {
			if (data.status == true) {
				if (data.message && (!data.message_block || data.message_block != true)) {
					alert(data.message);
					LAYOUT.OVERLAY.close();
				} else if (data.message && (data.message_block == true)) {
					LAYOUT.OVERLAY.alert(data.message, false);
				}
				if (data.reload == true) {
					window.location.reload();
					return false;
				}
				if (data.navigate) {
					location.href = data.navigate;
					return false;
				}
			} else {
				if (data.message && (!data.message_block || data.message_block != true)) {
					alert(data.message.split("<br>").join(" "));
				} else if (data.message && (data.message_block == true)) {
					LAYOUT.OVERLAY.alert(data.message, true);
				}
			}
		}, "json");
	});
};
