$(document).ready(function() {
	var pollingID;
	var stream = {
		    title: "ChopChop Radio",
		    mp3:   "http://radio.chopchop.me:8000/radio"
	    },
	    ready  = false;
	
	$('.jp-jplayer').jPlayer({
		ready:             function(event) {
			ready = true;
			$(this).jPlayer("setMedia", stream);
		},
		play:              function() {
			startPolling()
		},
		pause:             function() {
			$(this).jPlayer("clearMedia");
			stopPolling()
		},
		stop:              function() {
			stopPolling()
		},
		error:             function(event) {
			if (ready && event.jPlayer.error.type === $.jPlayer.error.URL_NOT_SET) {
				$(this).jPlayer("setMedia", stream).jPlayer("play");
			}
		},
		swfPath:           "/local/templates/chopchop/scripts/vendor/jplayer",
		supplied:          "mp3",
		preload:           "none",
		wmode:             "window",
		useStateClassSkin: true,
		autoBlur:          false,
		keyEnabled:        true
	});
	
	function startPolling() {
		if (!pollingID) {
			pollingID = setInterval(function() {
				$.get('/api/getRadioTrackName.php', function(data) {
					var nameEl = $('.jp-song-name');
					var text   = nameEl.text()
					if (text !== data) {
						nameEl.text(data)
						nameEl.toggleClass('animate', nameEl.width() >= 300)
					}
				})
			}, 5000)
		}
	}
	
	function stopPolling() {
		if (pollingID) {
			clearInterval(pollingID)
			pollingID = null
		}
	}
});

