/*   GEO   */
GEO                     = {
	locationFindingTimeout: 2000
};
GEO.calcDistance        = function(p1, p2) {
	/*
	var R = 6378137; // Earths mean radius in meter
	var dLat = (p2.lat - p1.lat) * Math.PI / 180;
	var dLong = (p2.lng - p1.lng) * Math.PI / 180;
	var a = Math.sin(dLat / 2) * Math.sin(dLat / 2) + Math.cos(p1.lat * Math.PI / 180) * Math.cos(p2.lat * Math.PI / 180) * Math.sin(dLong / 2) * Math.sin(dLong / 2);
	var c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
	var d = R * c;
	return d;
	*/
	return Math.round(Math.sqrt(Math.pow(p1.lat - p2.lat, 2) + Math.pow(p1.lng - p2.lng, 2)) * 1000) / 1000;
};
GEO.init                = function() {
	// Check if city already selected
	if ($('html').hasClass('located')) {
		GEO.city = {
			code: $('html').attr('data-city-code')
		};
	} else {
		// Event
		document.onGeolocationReady = new CustomEvent('onGeolocationReady');
		document.addEventListener('onGeolocationReady', function() {
			GEO.getNearestCity();
		});
		
		this.getGeolocation();
	}
};
GEO.getGeolocation      = function() {
	if (!navigator.geolocation) {
		this.getGeolocationByIP();
	} else {
		this.getGeolocationByGPS();
	}
};
GEO.getGeolocationByGPS = function() {
	var options = {
		enableHighAccuracy: true,
		timeout:            5000,
		maximumAge:         0
	};
	
	navigator.geolocation.getCurrentPosition(function(position) {
		GEO.location = {
			lat: position.coords.latitude,
			lng: position.coords.longitude
		}
		console.log('Geolocation: Ok');
		document.dispatchEvent(document.onGeolocationReady);
	}, function() {
		GEO.getGeolocationByIP();
		console.log('Geolocation: Failed getting by GPS. Trying by IP address.');
	}, options);
};
GEO.getGeolocationByIP  = function() {
	// Firstly check cookies
	
	// If no cookies get new geolocation
	GEO.locationFindingTimeoutId = setTimeout(function() {
		console.log('Geolocation: Failed getting by IP address.');
	}, GEO.locationFindingTimeout);
	
	$.getJSON('https://freegeoip.net/json/').done(function(location) {
		if (GEO.locationFindingTimeoutId) {
			clearTimeout(GEO.locationFindingTimeoutId);
		}
		
		GEO.location = {
			lat: location.latitude,
			lng: location.longitude
		};
		console.log('Geolocation: Ok');
		document.dispatchEvent(document.onGeolocationReady);
	});
};
GEO.getNearestCity      = function() {
	if (GEO && GEO.location && GEO.location.lat && GEO.location.lng) {
		//alert(GEO.location.lat + "," + GEO.location.lng);
		$.getJSON('/api/getNearestCity.php', {lat: GEO.location.lat, lng: GEO.location.lng}).done(function(json) {
			GEO.nearestCities = json.cities;
			console.log('Geolocation: Nearest city is ' + json.nearest.name);
			
			// Language
			var urlPrefix = '';
			if ($('html').attr('lang') != 'ru-RU') {
				var urlPrefix = 'en/';
				var text = 'Is your city ' + json.nearest.name_en + '?';
			} else {
				var text = '  ' + json.nearest.name + '?';
			}
			
			// Redirect
			if (confirm(text)) {
				Cookies.set('CC_CITY', json.nearest.code, {expires: 7, path: '/'});
				if (json.nearest.code.indexOf('://') < 0) {
					location.href = '/' + urlPrefix + 'city/' + json.nearest.code + '/';
				} else {
					location.href = json.nearest.code;
				}
			}
		});
	}
};
/* # GEO # */

GEO.init();
/* End */
